window.bookSummaryJSON = "<p><b><i>The Bond has been made, </i></b><i><br> </i><b><i>Reid and Cyrus will never let me go.</i></b><br> <br> But who is trapped with who?<br> <br> They will protect me from my father.<br> Rescue the Fae who were stolen.<br> And indulge my deepest, darkest desires.<br> <br> They have their hidden agendas.<br> But I have mine.<br> <br> As the world turns to darkness in Ivan's shadow, the Dark Fae grow in number and ferocity.<br> The lines between magic and science are blurred, and a hidden weapon lies in wait.<br> <br> Is there a way out of this? Reid believes there is. But our freedom will come at a heavy price.<br> One a hero will have to pay.<br> <br> But there are no heroes here.<br> <br> <b><i>Fall of the Fae is book 2 in \"The Stolen Fae series\". It's a dark, urban-fantasy romance full of magic, danger, passion, and pain.</i></b><br> <br> <i>Please Note: This is a reverse harem book and contains explicit content and darker elements, including mature language, violence, torture and non-consensual sex. It is not intended for anyone under 18 years of age.</i></p>"; 
